# https://leetcode.com/problems/three-equal-parts/solution/
# Runtime: 392 ms, faster than 52.63% of Python3 online submissions for Three Equal Parts.
# Memory Usage: 15.3 MB, less than 48.42% of Python3 online submissions for Three Equal Parts.
class Solution:
    def threeEqualParts(self, arr: List[int]) -> List[int]:
        n = len(arr)
        result = [-1, -1]
        S = sum(arr)
        if S % 3:
            return result
        T = S // 3
        if T == 0:
            return [0, n-1]
        breaks = []
        su = 0
        for i, x in enumerate(arr):
            if not x:
                continue
            su += x
            if su in {1, T+1, 2*T+1}:
                breaks.append(i)
            if su in {T, 2*T, 3*T}:
                breaks.append(i)

        i1, j1, i2, j2, i3, j3 = breaks
        if not(arr[i1:j1+1] == arr[i2:j2+1] == arr[i3:j3+1]):
            return result
        x = i2 - j1 - 1
        y = i3 - j2 - 1
        z = n - j3 - 1
        if x < z or y < z:
            return result
        j1 += z
        j2 += z
        return [j1, j2+1]


